  false,\n\t\"url\": null,\n\t\"notes\": \"nThis product contains ice edge coordinates
  for the Nordic Seas from 1750 through 2002 for months March through August. Ice
  edge in this product is defined as the outer boundary of ice having at least 30%
  ice concentration. Data are derived from publicly available sea ice products and
  use observational data from ship logbooks, diaries and other sources in addition
  to more recent satellite data products from the Scanning Multichannel Microwave
  Radiometer (SMMR) and the Special Sensor Microwave Imager (SSM/I). The data are
  distributed via FTP in ASCII, JPEG, and shapefile format.n\",\n\t\"license_title\":
